import { View, Text, Image } from 'react-native'
import React from 'react'

const TuyChon = () => {
  return (
    <View style={{flex:1}}>
     <View style={{height:150, backgroundColor:'purple'}}>
     <Image source={{ uri: 'https://randomuser.me/api/portraits/men/68.jpg' }} style={{ width: 100, height: 100, borderRadius: 25 }} />

     </View>
    </View>
  )
}

export default TuyChon
